import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Cards from '../Cards';
import './Drawing.css'

function Drawing() {
    const[url,setUrl] = useState("getg");

    var categorys = [
        {
            category: "category 1"

        },
        {
            category: "category 2"

        },
        {
            category: "category 3"

        },
        {
            category: "category 4"

        },
        {
            category: "category 5"

        },
        {
            category: "category 6"

        }
    ]
    
    return (
        <div>
            <div className='button-bar'>
                <ul className='button-bar-ul'>
                    <button>pasan</button>
                    <button>naml</button>

                </ul>
            </div>
            <Cards 
                status = {false}
                url = 'getg'

            />
            
        </div>
    )
}

export default Drawing
